import React from "react";
import { Container, Text, PrimaryButton } from "../../styledComponents";
import styled from "styled-components";

const SearchWrapper = styled(Container)`
  width: 100%;
  flex: 0;
  flex-direction: row;
  justify-content: "space-between";
  padding-right: 120px;
  padding-top: 30px;
  padding-bottom: 30px;
  padding-left: 120px;
  background-color: "white";
`;
const Houses = () => {
  return (
    <Container column flex={1} color="blue">
      <SearchWrapper>
        <Text>What house are you looking for?</Text>
        <PrimaryButton>Search</PrimaryButton>
      </SearchWrapper>
      >
    </Container>
  );
};

export default Houses;
